import React from "react";
import ExpenseForm from "./ExpenseForm";
import "./NewExpense.css";
const NewExpense = () => {
  const addNewExpense = () => {};
  return (
    <div className="new-expense">
      <ExpenseForm onSaveExpenseHandle={addNewExpense} />
    </div>
  );
};
export default NewExpense;
